/**** Start Blueprint *****/
/* multi select */
.bp4-multi-select-popover .bp4-menu {
  max-height: 300px;
  max-width: 470px;
  overflow: auto;
}

/* Input fields */
.bp4-input {
  border: 0.7px solid ${S2.LIGHT_GRAY1};
  box-shadow: inset 0px 1px 1px rgba(16, 22, 26, 0.2);
}

.bp4-input::placeholder {
  color: ${S2.GRAY3};
}

.disabled-filter input,
.disabled-filter > .bp4-input,
.disabled-filter.bp4-input {
  background: none !important;
  color: ${S2.DARK_GRAY1} !important;
}

.disabled-filter > select,
.disabled-filter > button {
  background-color: ${S2.LIGHT_GRAY5} !important;
  color: ${S2.DARK_GRAY1} !important;
}
.disabled-filter > .bp4-icon-caret-down,
.disabled-filter > .bp4-icon-double-caret-vertical,
.disabled-filter > .bp4-button-group {
  display: none; /* Remove select arrow */
}

.bp4-multi-select-tag-input-input::placeholder {
  color: ${S2.GRAY3};
}

.bp4-dialog-container {
  padding-top: 110px; !important;
  align-items: flex-start !important;
}

.ace_editor.ace_autocomplete {
  width: 500px;
}

.toast-with-no-close-button [aria-label="Close"] {
  display: none;
}

/* Dadi changes */

.bp4-card {
  padding: 1rem;
}

.bp4-popover2-transition-container {
  z-index: 5718;
}
.bp4-popover2-content {
  font-size: ${Ku};
  max-width: 25rem;
}

.bp4-tooltip2.bp4-intent-success .bp4-popover2-content {
  background: ${NZ};
  color: ${pl};
}
.bp4-tooltip2.bp4-intent-success .bp4-popover2-arrow-fill {
  fill: ${NZ};
}

.m-feature-announcement-popover .bp4-overlay-content {
  z-index: 1100;
}

}

body {
    margin: 0;
    padding: 0;
    color: #222222;
    background: linear-gradient(rgb(47, 77, 111), rgb(110, 131, 154));
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;

}

.App {

}

.fadeout {

}
.p-multiselect-item {

.p-inputtext:enabled:focus, .p-inputswitch.p-focus .p-inputswitch-slider {

.m-basic-dropdown {
  position: relative;
  
  .p-dropdown {
    width: 100%;
    max-width: ${lu()?"40rem":"20rem"};
    border-radius: 0;
    border: none;
    border-bottom: 2px solid ${bZ};
    outline: none;
    font-family: inherit;
    .p-dropdown-trigger {
      width: 1.8rem;
    }
    .p-dropdown-label {
      font-size: ${Ku};
    }

    .p-dropdown-trigger-icon.p-clickable.pi.pi-chevron-up {
      font-size: x-small;
    }

      box-shadow: none;
      border-color: ${bZ};

      border-color: ${bZ};
    }

    .p-inputtext {
      padding-left: 0;

    }
  }

    font-family: inherit;
  }

  
}

        position: absolute;
        left: 15px;
        right: 15px;
        bottom: 0px;
      }
    }
    &:not(.p-disabled):hover {
      background-color: ${EXt} !important;
    }
  }
}

.p-dropdown-panel {
  margin-left: ${lu()?0:"-10px"};
  .p-dropdown-header {
    background-color: transparent;

      content: '';
      border-bottom: 1px solid ${bve};
      position: absolute;
      left: 10px;
      right: 10px;
      top: 2.75rem;
    }
  }
}

.p-dropdown-filter-container {

    font-size: ${Ku};
    padding: ${fA};
  }
  .p-dropdown-filter-icon {
    font-size: 0.875rem;
  }
}


// Tooltip
.p-tooltip.p-component {
  
  .p-tooltip-text {
    font-size: ${Ku};
    padding: ${cc};
  }
}
